        /// <summary>
        /// Used to get the weights and Abscissa used in Gauss-Legendre quadrature and transform the integration from -1 to 1 => from a to b
        /// </summary>
        /// <param name="a">Integral lower limit</param>
        /// <param name="b">Integral upper limit</param>
        /// <param name="precition">Quadrature precition</param>
        /// <returns>Gauss-Legendre quadrature Weights and Abscissa for used interval</returns>
        public List<QuaderatureItem> GaussLegendrePoints(double a, double b, int precition)
        {
            double a1 = (b - a) / 2;
            double a2 = (b + a) / 2;
            List<QuaderatureItem> result = new List<QuaderatureItem>();
            GaussLegendreQuaderature t = GaussLegendre.Find(x => x.Number == precition);
            if (t != null)
            {
                for (int i = 0; i < t.Number; i++)
                {
                    result.Add(new QuaderatureItem() { Weight = t.Items[i].Weight * a1, Abscissa = a1 * t.Items[i].Abscissa + a2 });
                }

                result.Sort();

                return result;
            }

            throw new Exception("The current precition is not implemented. Only use integer range 2-64.");
        }



        public List<GaussLegendreQuaderature> GaussLegendre { get; set; } = new List<GaussLegendreQuaderature>();
